window.bookSummaryJSON = "<p>Death was all he deserved . . . until it wasn't.</p> <p>No sooner than I step out of sight of Death, and what our deal has wrought, do I regret the words I've spoken.</p> <p>My heart aches from the harshness of my tongue, and I wonder if I have made a grave mistake.</p> <p>And yet, I do not turn back. No. Instead, I harden my heart against these thoughts. Against my feelings.</p> <p>Sealing my fate with yet another mistake borne of disobedience . . . not only to my mother's dying wish, but to the true desires of my soul.</p> <p>A fate that will force me to my very knees to save the ones I love. To save him. To save . . . us.</p> <p>Contains mature themes.</p>"; 
